PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_brand" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "products_productvariant" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "size_type" varchar(50) NOT NULL, "size_value" varchar(50) NOT NULL, "color" varchar(50) NOT NULL, "base_price" decimal NOT NULL, "current_price" decimal NOT NULL, "is_active" bool NOT NULL, "is_order" bool NOT NULL, "product_id" bigint NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "customers_promocode" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "last_day" date NOT NULL, "is_active" bool NOT NULL, "is_personal" bool NOT NULL, "amount" integer unsigned NULL CHECK ("amount" >= 0), "sale" decimal NULL);
CREATE TABLE IF NOT EXISTS "orders_cartitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "cart_id" bigint NOT NULL REFERENCES "orders_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED, "product_variant_id" bigint NOT NULL REFERENCES "products_productvariant" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "customers_promocodeclient" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "client_id" bigint NOT NULL REFERENCES "customers_client" ("id") DEFERRABLE INITIALLY DEFERRED, "promocode_id" bigint NOT NULL REFERENCES "customers_promocode" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "customers_promocodeusage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "used_at" date NULL, "client_id" bigint NOT NULL REFERENCES "customers_client" ("id") DEFERRABLE INITIALLY DEFERRED, "promocode_id" bigint NOT NULL REFERENCES "customers_promocode" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "products_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "slug" varchar(255) NOT NULL, "parent_id" bigint NULL REFERENCES "products_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_favorite" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created_at" datetime NOT NULL, "client_id" bigint NOT NULL REFERENCES "customers_client" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "uq_favorite_client_product" UNIQUE ("client_id", "product_id"));
CREATE TABLE IF NOT EXISTS "orders_cart" ("update_at" date NOT NULL, "create_at" date NOT NULL, "ordered_at" date NULL, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cart_total_sum" decimal NULL, "is_ordered" bool NULL, "status" varchar NULL, "shipping_address" text NULL, "client_id" bigint NOT NULL REFERENCES "customers_client" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "customers_client" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "surname" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "patronymic" varchar(255) NULL, "phone_number" varchar(12) NOT NULL UNIQUE, "birthday" date NOT NULL, "user_id" integer NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "image" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "customers_bonus" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "amount" decimal NOT NULL, "created_at" datetime NOT NULL, "expires_at" datetime NOT NULL, "is_active" bool NOT NULL, "order_id" bigint NULL REFERENCES "orders_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "client_id" bigint NOT NULL REFERENCES "customers_client" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "uniq_bonus_per_order" UNIQUE ("order_id"));
CREATE TABLE IF NOT EXISTS "payments_payment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cart_id" integer unsigned NOT NULL CHECK ("cart_id" >= 0), "order_id" varchar(64) NOT NULL, "payment_id" varchar(64) NULL, "status" varchar(32) NOT NULL, "payment_url" varchar(200) NULL, "raw_init_resp" text NULL CHECK ((JSON_VALID("raw_init_resp") OR "raw_init_resp" IS NULL)), "raw_last_callback" text NULL CHECK ((JSON_VALID("raw_last_callback") OR "raw_last_callback" IS NULL)), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "amount" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "products_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "description" text NOT NULL, "is_sale" bool NOT NULL, "is_new" bool NOT NULL, "is_active" bool NOT NULL, "slug" varchar(255) NOT NULL UNIQUE, "image" varchar(100) NULL, "sale" integer unsigned NOT NULL CHECK ("sale" >= 0), "brand_id" bigint NOT NULL REFERENCES "products_brand" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" bigint NOT NULL REFERENCES "products_category" ("id") DEFERRABLE INITIALLY DEFERRED, "price" decimal NULL, "is_hit" bool NOT NULL);
